import React from "react";
import "./style.css";

function Header(props) {

    return 
    <div className="header">
    <div className="header">{props.children}</div>
    <div className = "scores">
    Score:{props.score} TOP Score:{props.topscores} 
    </div>
    </div>

}
export default Header;


